import router from "@/router/index.js"

export default function auth(to, from, next) {

    async function asyncCall() {
        await store.commit('authUser') 

        if (!store.state.user) {
            router.push({name: 'SignUp'})
        }else{
            next()
        }
      }

    asyncCall();      


  }
